import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
   faPlay,
   faStop,
   faCheck,
   faTrash,
} from '@fortawesome/free-solid-svg-icons';

import Button from 'components/commons/Button/Button';

import styles from './CarTrack.module.scss';

function CarTrack() {

   return(
      <div className = { styles.carTrack}>
         <div className = { styles.controlBlock }></div>
         <Button name = { <FontAwesomeIcon icon = { faPlay } /> }/>
         <Button name = { <FontAwesomeIcon icon = { faStop } /> }/>
         <Button name = { <FontAwesomeIcon icon = { faCheck } /> }/>
         <Button name = { <FontAwesomeIcon icon = { faTrash } /> }/>
      </div>
   )
}

export default CarTrack;
